import React from 'react';
import * as S from './ComponentStyled';

export default function AutoControl() {
  return (
    <div>
      <S.Title>Auto Control</S.Title>
      <S.GeneralText style={{ fontWeight: 'bold', fontSize: '22px ', marginTop: '5px' }}>
        Input Target Name
      </S.GeneralText>

      <div style={{ display: 'flex' }}>
        <S.GeneralText style={{ marginRight: '5vh' }}>Name:</S.GeneralText>
        <div style={{ border: '1px solid white', width: '18vh', height: '2.5vh' }}></div>
      </div>
    </div>
  );
}
